(229, '', 1608226480, 'Thông báo và hướng dẫn kích hoạt lại tài khoản cũ EarntMoney !', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:14.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:red\">EarntMoney th&ocirc;ng b&aacute;o</span></span></span></strong></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:red\">Chương tr&igrave;nh mới của EarntMoney đ&atilde; &nbsp;ch&iacute;nh thức cho ra mắt <span style=\"background-color:white\">ng&agrave;y 17/12/2020.(version 1.4.2) tr&ecirc;n nền tảng hỗ trợ WebMobile.</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Th&ocirc;ng qua phi&ecirc;n bane mới lần n&agrave;y , ch&uacute;ng t&ocirc;i cung cấp th&ocirc;ng tin v&agrave; c&ocirc;ng cụ s&aacute;ng tạo nội dung mới nổi bật x&acirc;y dựng cộng đồng trực tiếp hợp t&aacute;c facebook, google, youtobe&hellip; c&aacute;c dịch vụ v&agrave; kiếm tiền từ c&ocirc;ng việc của c&aacute;c bạn gi&uacute;p</span></span></span></span></p>\r\n\r\n<p><img src=\"/img/upload/images/image-20201218002350-4.png\" style=\"height:24px; width:24px\" /><img src=\"/img/upload/images/image-20201218002350-5.png\" style=\"height:24px; width:24px\" /></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"background-color:white\"><span style=\"font-family:Calibri,sans-serif\"><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#050505\">To&agrave;n bộ</span></span></span></strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#050505\"> c&aacute;c t&agrave;i khoản đ&atilde; k&iacute;ch hoạt cũ sẽ được k&iacute;ch hoạt lại </span></span></span><strong><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:black\">MIỄN PH&Iacute;</span></span></span></strong> <span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#050505\">,kể cả những t&agrave;i khoản 10 ng&agrave;y kh&ocirc;ng hoạt động đ&atilde; bị kh&oacute;a &quot; Kh&ocirc;ng &aacute;p dụng cho c&aacute;c t&agrave;i khoản vi phạm ch&iacute;nh s&aacute;ch giới thiệu của EarntMoney&quot;</span></span></span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\">Kh&aacute;ch h&agrave;ng c&oacute; thể <span style=\"color:#0070c0\">mua b&aacute;n paypal </span>trực tiếp tr&ecirc;n trang web của ch&uacute;ng t&ocirc;i. Thanh to&aacute;n h&oacute;a đơn Internet, nạp tiền điện thoại, nạp Game đều được chiết khấu<span style=\"color:red\"> % </span>cao nhất hiện nay khi thanh to&aacute;n tại EarntMoney.com </span></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Calibri,sans-serif\"><span style=\"font-size:12.0pt\"><span style=\"font-family:&quot;Arial&quot;,&quot;sans-serif&quot;\"><span style=\"color:#ff0000\">*</span><span style=\"color:#c0392b\"> </span>Kiếm tiền trực tiếp bằng việc xem <span style=\"color:#ffc000\">VIDEO </span>tại EarntMoney , v&agrave; giới thiệu bạn b&egrave; để nhận th&ecirc;m nhiều <span style=\"color:#00b050\">tiền thưởng </span>hơn chi tiết xem tại: <a href=\"https://earntmoney.com/guide.php\" style=\"color:blue; text-decoration:underline\">https://earntmoney.com/guide.php</a></span></span></span></span></p>\r\n\r\n<p><span style=\"font-s